import { Routes, Route, Link } from 'react-router-dom';


const Home = ()=> <h1>Home</h1>

const SearchPage = () => {

  const arepa = [
    'queso',
    'pelua',
    'pabellon',
    'domino',
  ]

  return(
    <div>
      <h1>SearchPage</h1>
      <ul>
        {arepa.map}
      </ul>
    </div>
  )

}


function App() {
  return (
    <div>
      <header>
        <h1>miduchollos</h1>
        <nav>
          <ul>
            <li>
              <Link to='/'>Home</Link>
            </li>
            <li>
              <Link to='/search-page'>Search Page</Link>
            </li>
          </ul>
        </nav>
      </header>

      <Routes>
        <Route path='/' element={<Home />} />
        <Route path='/search-page' element={<SearchPage />} />
      </Routes>
    </div>
  );
}

export default App;
